import Modal from "react-bootstrap/Modal";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import "bootstrap/dist/css/bootstrap.min.css";
import { useContext, useState } from "react";
import { TypeContext } from "../contexts/TypeContext";
const AddTypeModal = () => {
  const { showAddTypeModal, setShowAddTypeModal } = useContext(TypeContext);

  const [newType, setNewType] = useState({
    type: "",
    TDS: "",
    dead_TDS: "",
    PH: "",
    dead_PH: "",
    nutri_ratio: "",
  });

  const { type, TDS, dead_TDS, PH, dead_PH, nutri_ratio } = newType;

  const onChangeNewTypeForm = (event) =>
    setNewType({ ...newType, [event.target.name]: event.target.value });

  const closeDialog = () => {
    setShowAddTypeModal(false);
  };

  return (
    <Modal show={showAddTypeModal} onHide={closeDialog}>
      <Modal.Header closeButton>
        <Modal.Title>Add new vegetables</Modal.Title>
      </Modal.Header>
      <Form>
        <Modal.Body>
          <Form.Group>
            <Form.Control
              type="text"
              placeholder="Type"
              className="type"
              required
              aria-describedby="title-help"
              value={title}
              onChange={onChangeNewTypeForm}
            />
            <Form.Text id="title-help" muted>
              Required
            </Form.Text>
          </Form.Group>
          <Form.Group>
            <Form.Control
              type="text"
              placeholder="TDS value"
              className="TDS value"
              value={TDS}
              onChange={onChangeNewTypeForm}
            />
          </Form.Group>
          <Form.Group>
            <Form.Control
              type="text"
              placeholder="TDS dead value"
              className="TDS_dead"
              value={title}
              onChange={onChangeNewTypeForm}
            />
          </Form.Group>
          <Form.Group>
            <Form.Control type="text" placeholder="PH value" className="PH" />
          </Form.Group>
          <Form.Group>
            <Form.Control
              type="text"
              placeholder="PH dead value"
              className="PH_dead"
              value={PH_dead}
              onChange={onChangeNewTypeForm}
            />
          </Form.Group>
          <Form.Group>
            <Form.Control
              type="text"
              placeholder="Nutri ratio value"
              className="nutri_Ratio"
              value={nutri_ratio}
              onChange={onChangeNewTypeForm}
            />
          </Form.Group>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={closeDialog}>
            Cancel
          </Button>
          <Button variant="primary" type="submit">
            Set
          </Button>
        </Modal.Footer>
      </Form>
    </Modal>
  );
};

export default AddTypeModal;
